import React from "react";

function SaveBtn() {
  return <button>Save</button>
}

function ConfirmBtn() {
  return <button>Confirm</button>
}

function Buttons() {
  return (
    <div>
      <SaveBtn />
      <ConfirmBtn />
    </div>
  );
}

export default Buttons;
